import Axios from "axios"

export default function CreateCookie( email, timestamp ) {

    Axios( {
        method: "post",
        url: "http://www.paste.services/access/rememberMe",
        headers: {
            'Content-Type': 'application/json; charset=UTF-8'
        },
        data: {
            "email": email,
            "key": timestamp
        },
    } ).then( ( res ) => {

        // Successfully logged in
        if ( res.data === "1" ) {
            return {
                "success": "1",
                "key": timestamp
            }
        }
        console.log( "Response: " + res.data )
    } )
}
